b'Last month, we committed to contributing to nonprofit organizations that support education, service and opportunity for the Black community. Today, we are sharing the latest organization that we are proud to support - @bmecommunity.

@bmecommunity is a network of innovators, leaders, and champions who invest in aspiring communities and are committed to building and supporting Black people\xe2\x80\x99s freedom to Live, Own, Vote, and Excel (Black L.O.V.E.) across the nation. #NextNarrative

